import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { DragDropContext, Droppable, Draggable } from "react-beautiful-dnd";
import { addField, reorderFields, updateLabel, updatePlaceholder, updateOptions } from './redux/actions/formFieldActions';
// Import all components

const App = () => {
  const dispatch = useDispatch();
  const formFields = useSelector((state) => state.formFields);
  const [selectedField, setSelectedField] = useState(null);

  const handleOnDragEnd = (result) => {
    const { destination, source } = result;
    if (!destination) return;

    if (source.droppableId === "sidebar" && destination.droppableId === "canvas") {
      const newField = {
        id: Date.now(),
        type: source.draggableId,
        label: "New Label",
        placeholder: "Enter placeholder",
        options: ["Option 1"],
        required: false,
      };
      dispatch(addField(newField));
    } else if (source.droppableId === "canvas" && destination.droppableId === "canvas") {
      const reorderedFields = Array.from(formFields);
      const [movedField] = reorderedFields.splice(source.index, 1);
      reorderedFields.splice(destination.index, 0, movedField);
      dispatch(reorderFields(reorderedFields));
    }
  };

  return (
    <div style={{ display: "flex", height: "100vh" }}>
      {/* Sidebar */}
      <DragDropContext onDragEnd={handleOnDragEnd}>
        <Droppable droppableId="sidebar" isDropDisabled={true}>
          {(provided) => (
            <div {...provided.droppableProps} ref={provided.innerRef} className="sidebar">
              <h3>Components</h3>
              {["textInput", "textArea", "selectDropdown", "checkbox", "datePicker", "radioButtons", "fileUpload"].map((type, index) => (
                <Draggable key={type} draggableId={type} index={index}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      className="component-item"
                    >
                      {type.replace(/([A-Z])/g, ' $1').trim()}
                    </div>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </div>
          )}
        </Droppable>

        {/* Canvas */}
        <Droppable droppableId="canvas">
          {(provided) => (
            <div {...provided.droppableProps} ref={provided.innerRef} className="canvas">
              {formFields.map((field, index) => (
                <Draggable key={field.id} draggableId={String(field.id)} index={index}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      className="field-container"
                      onClick={() => setSelectedField(field)}
                    >
                      {/* Render actual component preview */}
                      <div className="component-preview">
                        {field.type === "textInput" && <TextInput {...field} />}
                        {field.type === "textArea" && <TextArea {...field} />}
                        {field.type === "selectDropdown" && <DropDown {...field} />}
                        {field.type === "checkbox" && <CheckBox {...field} />}
                        {field.type === "datePicker" && <DatePicker {...field} />}
                        {field.type === "radioButtons" && <RadioButtons {...field} />}
                        {field.type === "fileUpload" && <FileUpload {...field} />}
                      </div>
                    </div>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </div>
          )}
        </Droppable>
      </DragDropContext>

      {/* Properties Panel */}
      {selectedField && (
        <div className="properties-panel">
          <h3>Properties</h3>
          <div className="form-group">
            <label>Label</label>
            <input
              type="text"
              value={selectedField.label}
              onChange={(e) => dispatch(updateLabel(selectedField.id, e.target.value))}
            />
          </div>
          <div className="form-group">
            <label>Placeholder</label>
            <input
              type="text"
              value={selectedField.placeholder}
              onChange={(e) => dispatch(updatePlaceholder(selectedField.id, e.target.value))}
            />
          </div>
          {(selectedField.type === "selectDropdown" || selectedField.type === "checkbox" || selectedField.type === "radioButtons") && (
            <div className="options-section">
              <button onClick={() => dispatch(updateOptions(selectedField.id, null, "New Option"))}>
                Add Option
              </button>
              {selectedField.options.map((option, index) => (
                <input
                  key={index}
                  type="text"
                  value={option}
                  onChange={(e) => dispatch(updateOptions(selectedField.id, index, e.target.value))}
                />
              ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default App;
